/* eslint-disable no-unused-vars */
/* eslint-disable react/prop-types */
import {
  Card,
  CardContent,
  Grid,
  Chip,
  Typography,
  rgbToHex,
} from "@mui/material";
import PropTypes from "prop-types";
import { MachineWithNumber } from "./machineIcon";
import { useMachineContext } from "../../../contexts/machinecontext";

export const MachineGrid = ({ ID }) => {
  const { machineData } = useMachineContext();

  // Find the machine with the given machineID from machineData
  const machine = machineData.find((machine) => machine.machineID === ID);

  if (!machine) {
    // Handle the case where the machine with the specified ID is not found
    return <div>{ID}</div>;
  }

  const {
    machineID,
    moldId,
    monaNumber,
    status,
    moldShots,
    failedShots,
    prodRate,
    prod_startDate,
    prod_startTime,
    prod_endDate,
    prod_endTime,
    material,
    moldMaker,
    ...others
  } = machine;
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Card
        variant="outlined"
        xs={12}
        sx={{
          margin: 0,
          padding: 0,
          borderWidth: 3,
          // maxWidth: 500,
          // maxHeight: 400,
          display: "flex",
          width: "100%",
          height: "100%",
          backgroundColor: "rgba(255, 0, 0)",
          flexDirection: "row",
        }}
      >
        <CardContent
          alignItems="center"
          justifyContent="center"
          sx={{
            margin: 0,
            padding: 0,
          }}
        >
          <Grid>
            <Grid container>
              <Grid
                alignItems="center"
                justifyContent="center"
                // sx={{ backgroundColor: "red" }}
              >
                <Grid alignItems="end" justifyContent="center">
                  <Typography
                    variant="h6"
                    padding={1}
                    paddingTop={1}
                    color="textSecondary"
                  >
                    <MachineWithNumber count={machineID} />
                    <Grid item>
                      <Typography
                        variant="h7"
                        component="div"
                        textAlign="left"
                        color="black"
                      >
                        <Chip label={material} color="info" />
                      </Typography>
                    </Grid>
                  </Typography>
                </Grid>
              </Grid>
              <Grid
                alignItems="center"
                justifyContent="end"
                xs={10}
                // sx={{ backgroundColor: "red" }}
              >
                <Grid item textAlign="center" xs={12} padding={1}>
                  <Grid
                    container
                    alignItems="center"
                    justifyContent={"end"}
                    spacing={2}
                  >
                    <Grid item>
                      <Typography
                        variant="h6"
                        component="div"
                        textAlign="left"
                        color="black"
                      >
                        {moldId}
                      </Typography>
                    </Grid>
                    <Grid item>
                      <Typography
                        variant="h6"
                        component="div"
                        textAlign="left"
                        color="black"
                      >
                        {monaNumber}
                      </Typography>
                    </Grid>
                  </Grid>
                </Grid>

                {/* mold deltails */}
                <Grid item textAlign="center" xs={12} margin={0} padding={1}>
                  <Grid
                    container
                    alignItems="center"
                    justifyContent={"end"}
                    spacing={2}
                  >
                    <Grid item>
                      <Typography
                        variant="h6"
                        component="div"
                        textAlign="left"
                        color="black"
                      >
                        <Chip label={moldMaker} color="primary" />
                      </Typography>
                    </Grid>
                  </Grid>
                </Grid>
              </Grid>
            </Grid>

            {/* statistics */}
            <Grid item xs={12} margin={0}>
              <Grid
                container
                direction="row"
                justifyContent={"space-between"}
                alignItems="center"
              >
                <Grid
                  item
                  xs={6}
                  padding={1}
                  justifyContent="center"
                  alignItems="center"
                  sx={{ backgroundColor: "success.main" }}
                >
                  <Typography
                    variant="h6"
                    component="div"
                    textAlign="center"
                    color="white"
                  >
                    {moldShots}
                  </Typography>
                </Grid>
                <Grid
                  item
                  xs={6}
                  padding={1}
                  justifyContent="center"
                  alignItems="center"
                  sx={{ backgroundColor: "error.main" }}
                >
                  <Typography
                    variant="h6"
                    component="div"
                    textAlign="center"
                    color="white"
                  >
                    {failedShots}
                  </Typography>
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </CardContent>
      </Card>
    </div>
  );
};

MachineGrid.propTypes = {
  machineID: PropTypes.string.isRequired,
};
